import AppLayout from "../component/AppLayout";
import { Input, Empty } from "antd";

const Home = () => {
  const onSearch = (value) => console.log(value);
  return (
    <AppLayout version="3.5-turbo">
      <Input.Search
        placeholder="input search text"
        onSearch={onSearch}
        allowClear
        enterButton="Search"
        size="large"
      ></Input.Search>
      <Empty description="hello"></Empty>
    </AppLayout>
  );
};

export default Home;
